import styled from 'styled-components';

export const MainContainer = styled.div`
    background: #c4ebf1;
    display: flex;
    justify-content: center;
    align-items: center;
    padding: 0 30px;
    height: 800px;
    position: relative;
    z-index: 1;
`;

export const MainContent = styled.div`
    z-index: 3;
    max-width: 1200px;
    position: absolute;
    padding: 8px 24px;
    display: flex;
    flex-direction: column;
    align-items: center;
`;

export const MainCard = styled.div`
    background-color: white;
    width: 50px;
    height: 50px;
`;
